@LivEchonews Was a great day when we took a 4yo but price has rocketed since before covid and hugely overpriced for an accompanying adult (90% of visit is for the child).
Price is fair for the child, but cost for an adult (or 2) to walk around with a child makes this a no go now.
Huge shame.

@JBuchtela @F0STRE @BBCNews The vaccination rate in China is very high, about 80%.
But the elderly are afraid of side effects, so the vaccination rate is relatively low.
And the adoption of the zero-covid policy also makes the elderly more reluctant to be vaccinated.
